import React from 'react';
import { Navbar, Nav, Container } from 'react-bootstrap';
import { Link } from 'react-router-dom';
import LoginSignUp from './LoginSignUpButton'; // Import the LoginSignUp component

const NavbarComponent = () => {
  return (
    <Navbar bg="dark" variant="dark" expand="lg" className="justify-content-between">
        <Container>
            {/* Navbar links (Home, About, Gallery) and brand logo */}
            <Navbar.Brand as={Link} to="/home">Big Cat Rescue</Navbar.Brand>
            <Nav>
                <Nav.Link as={Link} to="/home">Home</Nav.Link>
                <Nav.Link as={Link} to="/about">About</Nav.Link>
                <Nav.Link as={Link} to="/gallery">Gallery</Nav.Link>
            </Nav>
        </Container>
        {/* Button group for Login/Sign up */}
        <LoginSignUp />
    </Navbar>
  );
};

export default NavbarComponent;
